import { useState } from "react";

function BookCreate ()
{
    const [title, setTitle] = useState('');

    const onChange = (event) =>
    {
        setTitle(event.title.value);
    };

    return <div>
        <h1>Add new book</h1>
        <form>
            <label>Enter title</label>
            <input />
            <button>Submit</button>
        </form>
    </div>;
}

export default BookCreate;
